texto:
A 
@petrogustavo
 no se le ha comprobado que ha desgarrado los recursos públicos. Lo investigaron pero no hubo nada que mostrar.

Usted es un gran candidato y tendría mi voto y el de mucho pero debemos unirnos para ganarles a los mismos, aquí el único que ha desangrado a Colombia por décadas es la extrema derecha y en los últimos 20 años fue 
@AlvaroUribeVel
 asi que a petro debería sacarlo de ese sancocho!

Pero una alianza con un excelente hombre que es 
@CamiloRomero
  sería

Pero usted dijo w le agradaba 
@AlvaroUribeVel
 ya con eso usted no es de confianza...

Yo voto por el que diga 
@AlvaroUribeVel
 me daría miedo votar por 
@ingrodolfohdez

Y que pasaría 
@ingrodolfohdez
 si no llega, pondrá su electorado al servicio de una diferente a usted?

Cucho nos va a traer todas esas ratas de Santander le recuerdo que usted utilizo la alcaldía como su casa y para sus amigos a nosotros no nos salga con cuentos chinos, para eso tenemos a 
@ClaudiaLopez
 que es peor o igual.

Le salió competencia a 
@CamiloRomero
 ... A dividir más los votos

Y 
@petrogustavo
 cuándo, cómo y con quién "Desangró a Colombia"

Señor Rodolfo aún me queda una pizca de confianza en usted ojalá no sea una 
@ClaudiaLopez
 más !!!
